        "title": "Naturkatastrophen: Wie Tiere und Pflanzen überleben | Doku HD | ARTE",
        "description": "Im Laufe von Millionen von Jahren bewiesen zahlreiche Lebewesen angesichts tiefgreifender Extremwetterereignisse beeindruckende Anpassungsfähigkeiten. Angesichts einer ungewissen Zukunft und der Schnelligkeit klimatischer Veränderungen zeigt sich die Wissenschaft besorgt. Werden die Tiere imstande sein, sich wirksam den Veränderungen der nächsten Jahrzehnte anzupassen?\r\n\r\nWirbelstürme, Erdbeben, Vulkanausbrüche. Wie reagieren eigentlich Tiere und Pflanzen auf solche Naturkatastrophen? Einige Tiere können kurz bevorstehende Naturkatastrophen vorausahnen und sich vor ihnen schützen. Andere sind zum Bleiben gezwungen und müssen gegen die Unwägbarkeiten der Natur um ihr Überleben kämpfen.\nSeit nun einiger Zeit untersucht die Wissenschaft, wie Flora und Fauna auf die Launen unseres Planeten reagieren. Sie entdeckt bemerkenswerte Überlebensstrategien. Dennoch bleibt ungewiss, obTiere und Pflanzen auch in der Lage sein werden, sich den neuen, menschengemachten Herausforderungen zu stellen.\nDer Zug der Vögel von Kanada nach Brasilien ist von starken Wetterereignissen beeinflusst. Während der Sturmsaison wird die Reise durch kräftige Winde und atmosphärische Niederschläge gestört. Die Insel Puerto Rico beheimatet Ameisen, die Überschwemmungen überstehen, indem sie kompakte Flöße bilden und sich mit der Strömung davontreiben lassen. Die australische Flora und Fauna hat sich an die alljährlichen Buschfeuer angepasst: Gewisse Vögel profitieren von den Bränden, da sie dank ihnen Beute einfacher aufstöbern. Nichtsdestotrotz haben die Tierarten angesichts des gegenwärtigen Klimawandels, der seit der Industrialisierung vorangetrieben wird, nur wenig Zeit zur Anpassung. Der Anstieg des mittleren Meeresspiegels, die Häufung zerstörerischer Wirbelstürme und gigantische Waldbrände übersteigen alles, was bisher beobachtet wurde. Angesichts einer ungewissen Zukunft und der Schnelligkeit der Veränderungen zeigt sich die Wissenschaft besorgt. Es lässt sich unmöglich voraussagen, inwiefern die Tiere imstande sein werden, sich wirksam den Veränderungen der nächsten Jahrzehnte anzupassen.\r\n\r\nDokumentation von Keebe Kennedy (F 2021, 53 Min)\r\n\r\n\r\n#naturkatastrophen #natur #doku \nVideo auf Youtube verfügbar bis zum 28/09/2022\nAbonniert den Youtube-Kanal von ARTE:  http://www.youtube.com/user/ARTEde\n\nFolgt uns in den sozialen Netzwerken: \nFacebook: http://www.facebook.com/ARTE.tv\nTwitter: https://twitter.com/ARTEde\nInstagram: https://www.instagram.com/arte.tv/",
